import './Withdraw.css';
import Media from 'react-media';
import { IoWallet } from 'react-icons/io5';
import { useNavigate } from 'react-router-dom';

// Butto withdrae with dash
export default function ReturnButtonWithdrAw() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};

export const ScreenLarge = () => (
 <div className='wrp-withdraw-dash'>
  <ViewBtn />
 </div>
);
export const ScreenSmall = () => (
 <div className='wrp-withdraw-dash-sm'>
  <ViewBtn />
 </div>
);

export const ViewBtn = () => {
 const navigation = useNavigate();

 const handlepath = (event) => {
  event.preventDefault();
  navigation('/send');
 }

 return (
  <button onClick={handlepath} className='Btn'><span>Envoyer</span> <IoWallet size={'1.4em'} /></button>
 );
}
